webpackJsonp([76018769570884],{1419:function(e,a){e.exports={data:{site:{siteMetadata:{title:"Psyked: James' Web Development website",author:"James Ford"}},markdownRemark:{id:"/Users/James/Repositories/portfolio-2018/src/posts/runmaps-4-apply-ui-sprinkles-go-live/index.md absPath of file >>> MarkdownRemark",html:'<h1>RunMaps #4: Apply UI Sprinkles &#x26; Go Live!</h1>\n<h2>With all this effort spent building RunMaps, wouldn’t it be a shame to not share it with the world?</h2>\n<p>For all its flaws, I’m happy to say that my first version of RunMaps is online for the world to see at <a href="https://psyked.github.io/runmaps/">https://psyked.github.io/runmaps/</a></p>\n<p>For posterity, here’s a couple of screenshots of the site as it currently stands, and scroll below for a little more about the reasoning behind all this fancy design work.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-56bef.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 Q5ErbRicXQ2cSw9VhhPXXg"\n        title=""\n        src="/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-082ce.png"\n        srcset="/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-c7cb1.png 158w,\n/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-93041.png 315w,\n/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-082ce.png 630w,\n/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-c4006.png 945w,\n/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-56bef.png 1200w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*K-IqbH5Pj8yQBWnHpBGTQg-36252f3ba541cba254e2ccfe6f7d1f86-56bef.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.33333333333331%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 K IqbH5Pj8yQBWnHpBGTQg"\n        title=""\n        src="/static/1*K-IqbH5Pj8yQBWnHpBGTQg-36252f3ba541cba254e2ccfe6f7d1f86-082ce.png"\n        srcset="/static/1*K-IqbH5Pj8yQBWnHpBGTQg-36252f3ba541cba254e2ccfe6f7d1f86-c7cb1.png 158w,\n/static/1*K-IqbH5Pj8yQBWnHpBGTQg-36252f3ba541cba254e2ccfe6f7d1f86-93041.png 315w,\n/static/1*K-IqbH5Pj8yQBWnHpBGTQg-36252f3ba541cba254e2ccfe6f7d1f86-082ce.png 630w,\n/static/1*K-IqbH5Pj8yQBWnHpBGTQg-36252f3ba541cba254e2ccfe6f7d1f86-c4006.png 945w,\n/static/1*K-IqbH5Pj8yQBWnHpBGTQg-36252f3ba541cba254e2ccfe6f7d1f86-56bef.png 1200w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<hr>\n<h3>Proof of Concept vs. Minimum Viable Product</h3>\n<p>RunMaps so far has been a Proof of Concept; the full-screen, non-interactive maps described in my previous posts <a href="https://medium.com/@psyked/generating-run-maps-with-node-js-52738014d3dc">[here]</a> <a href="https://medium.com/@psyked/runmaps-v2-0-breaking-free-of-mapbox-dbe3c3ca1a01">[here]</a> and <a href="https://medium.com/@psyked/runmaps-3-colour-schemes-and-labels-d7533eb91bc7">[here].</a> It proves the project concept, but all of the settings and routes are baked into the source code and that makes it a little hard to test with different scenarios or share with any beta testers.</p>\n<p>Getting beta testers (or early-adopter customers) ‘on board’ is important because they’re an efficient way of generating the edge-case tests needed to ensure product stability and the most independent way available of validating the journey and testing a customers’ workflow.</p>\n<h4>Enabling Beta Testers: Build an MVP!</h4>\n<p>When we talk of Minimum Viable Product we’re essentially talking about the simplest possible way of delivering a project. Taking RunMaps from a POC and turning it into a MVP is all about enabling beta testers, making it possible for them to use the tool and help to refine it. Given the scope of what RunMaps does, this essentially translates into adding some basic user interface controls so that users can test and create maps using their own data.</p>\n<h3>Minimum Viable Product (MVP)</h3>\n<p>Users need the ability to upload route data, preview and then save the output that has been generated from that data. It doesn’t need to be any more fancy than that, and anything extra is arguably not delivering any extra value.</p>\n<p>Unfortunately I didn’t take any screenshots of the MVP version of RunMaps, but let’s just say the initial MVP for RunMaps was boring. It basically consisted of a file input component, some text inputs for output dimensions, and a button to click to save the output. All done using the default HTML component styling.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*93ZaKMV7ciF9GM4AS7Dr9w-e516ff5b5915cd9cfa4ba936f6167916-85ae7.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 74.9375%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 93ZaKMV7ciF9GM4AS7Dr9w"\n        title=""\n        src="/static/1*93ZaKMV7ciF9GM4AS7Dr9w-e516ff5b5915cd9cfa4ba936f6167916-082ce.png"\n        srcset="/static/1*93ZaKMV7ciF9GM4AS7Dr9w-e516ff5b5915cd9cfa4ba936f6167916-c7cb1.png 158w,\n/static/1*93ZaKMV7ciF9GM4AS7Dr9w-e516ff5b5915cd9cfa4ba936f6167916-93041.png 315w,\n/static/1*93ZaKMV7ciF9GM4AS7Dr9w-e516ff5b5915cd9cfa4ba936f6167916-082ce.png 630w,\n/static/1*93ZaKMV7ciF9GM4AS7Dr9w-e516ff5b5915cd9cfa4ba936f6167916-c4006.png 945w,\n/static/1*93ZaKMV7ciF9GM4AS7Dr9w-e516ff5b5915cd9cfa4ba936f6167916-85e68.png 1260w,\n/static/1*93ZaKMV7ciF9GM4AS7Dr9w-e516ff5b5915cd9cfa4ba936f6167916-85ae7.png 1600w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*qK62tXHag_5yOgfQn2wQjQ-2d0b9dc87b3a54c8459ed79c79b3fbff-58fd0.png"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.375%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/png;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 qK62tXHag 5yOgfQn2wQjQ"\n        title=""\n        src="/static/1*qK62tXHag_5yOgfQn2wQjQ-2d0b9dc87b3a54c8459ed79c79b3fbff-082ce.png"\n        srcset="/static/1*qK62tXHag_5yOgfQn2wQjQ-2d0b9dc87b3a54c8459ed79c79b3fbff-c7cb1.png 158w,\n/static/1*qK62tXHag_5yOgfQn2wQjQ-2d0b9dc87b3a54c8459ed79c79b3fbff-93041.png 315w,\n/static/1*qK62tXHag_5yOgfQn2wQjQ-2d0b9dc87b3a54c8459ed79c79b3fbff-082ce.png 630w,\n/static/1*qK62tXHag_5yOgfQn2wQjQ-2d0b9dc87b3a54c8459ed79c79b3fbff-58fd0.png 800w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>A couple of screenshots of the not-quite-so-ugly interim version of RunMaps.</p>\n<h4>Sometimes an MVP is not enough.</h4>\n<p>When it actually came to getting beta testers on board, I had to explain exactly how to use the application and what it was supposed to be doing, and I had to repeat this for every new user.</p>\n<p>What I really learnt from this process is that you can take ‘Lean UX’ too far. A project needs to be self-explanatory enough to stand on its own, and appealing enough to not put off new customers. To tackle this challenge, I decided to go back to pen and paper, and get stuck into some designs, to understand what a Minimum Loveable Product might look like.</p>\n<h3>Minimum Loveable Product (MLP)</h3>\n<p>It’s easy to get ‘stuck in a rut’ and lose the grand perspective when you spend all of your time working with code. I wasn’t happy with how the interface looked, my users weren’t finding it very exciting to use, and development velocity was dropping because I had no clear idea of how the product should look or feel. In short, I had no product Vision.</p>\n<p>To come up with a Vision for RunMaps, it was time to ditch the code entirely, grab a pen and paper, and start re-imagining the end goal.</p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*17wmDypNX5M6GHcdvm-4zw-79efb46fa6431e786f51d08b48795fae-75110.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 133.25%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 17wmDypNX5M6GHcdvm 4zw"\n        title=""\n        src="/static/1*17wmDypNX5M6GHcdvm-4zw-79efb46fa6431e786f51d08b48795fae-af57e.jpeg"\n        srcset="/static/1*17wmDypNX5M6GHcdvm-4zw-79efb46fa6431e786f51d08b48795fae-847f7.jpeg 158w,\n/static/1*17wmDypNX5M6GHcdvm-4zw-79efb46fa6431e786f51d08b48795fae-93973.jpeg 315w,\n/static/1*17wmDypNX5M6GHcdvm-4zw-79efb46fa6431e786f51d08b48795fae-af57e.jpeg 630w,\n/static/1*17wmDypNX5M6GHcdvm-4zw-79efb46fa6431e786f51d08b48795fae-75110.jpeg 800w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>\n  <a\n    class="gatsby-resp-image-link"\n    href="/static/1*9pnLd7Q0OZdbaUfhNCqbkw-603aa5645a75fb0707e31574ace1c8bd-3a143.jpeg"\n    style="display: block"\n    target="_blank"\n    rel="noopener"\n  >\n  \n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; ; max-width: 630px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 75%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; height: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="1 9pnLd7Q0OZdbaUfhNCqbkw"\n        title=""\n        src="/static/1*9pnLd7Q0OZdbaUfhNCqbkw-603aa5645a75fb0707e31574ace1c8bd-af57e.jpeg"\n        srcset="/static/1*9pnLd7Q0OZdbaUfhNCqbkw-603aa5645a75fb0707e31574ace1c8bd-847f7.jpeg 158w,\n/static/1*9pnLd7Q0OZdbaUfhNCqbkw-603aa5645a75fb0707e31574ace1c8bd-93973.jpeg 315w,\n/static/1*9pnLd7Q0OZdbaUfhNCqbkw-603aa5645a75fb0707e31574ace1c8bd-af57e.jpeg 630w,\n/static/1*9pnLd7Q0OZdbaUfhNCqbkw-603aa5645a75fb0707e31574ace1c8bd-28cf9.jpeg 945w,\n/static/1*9pnLd7Q0OZdbaUfhNCqbkw-603aa5645a75fb0707e31574ace1c8bd-0d474.jpeg 1260w,\n/static/1*9pnLd7Q0OZdbaUfhNCqbkw-603aa5645a75fb0707e31574ace1c8bd-3a143.jpeg 1600w"\n        sizes="(max-width: 630px) 100vw, 630px"\n      />\n    </span>\n  </span>\n  \n  </a>\n    </p>\n<p>Doodles from the ever-present notebook of ideas.</p>\n<p>Spending some time away from the code seems to have the desired effect, giving me the break I needed to reconnect with my original idea for RunMaps and bridge the gaps between POC, MVP and MLP.</p>\n<hr>\n<p>I have many more topics I’d like to write about which have influenced my development of RunMaps, but I’ll save those for another day and instead encourage you to check it out at <a href="https://psyked.github.io/runmaps/">https://psyked.github.io/runmaps/</a></p>',frontmatter:{title:"RunMaps #4: Apply UI Sprinkles & Go Live!",date:"June 08, 2018",tags:["MVP","Side Project","Maps","Strava","Fitbit"],url:"https://medium.com/@psyked/runmaps-4-apply-ui-sprinkles-go-live-ceac2d4a9936",image:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:.75,src:"/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-7a72d.png",srcSet:"/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-8baea.png 158w,\n/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-69705.png 315w,\n/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-7a72d.png 630w,\n/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-514af.png 945w,\n/static/1*Q5ErbRicXQ2cSw9VhhPXXg-3ed3e2de478361ca318074b71e40f125-5e778.png 1200w",sizes:"(max-width: 630px) 100vw, 630px"}}},description:"With all this effort spent building RunMaps, wouldn’t it be a shame to not share it with the world?"}}},pathContext:{prev:{frontmatter:{path:"/blog/runmaps-3-colour-schemes-and-labels/",tags:["Mapping","Side Project","D3js","SVG"],title:"RunMaps 3: Colour Schemes and Labels",date:"2018-05-26T14:22:30.597Z",description:"Now it's time to pick up where we left the original development; improving the visuals by adding place labels and map markers.",image:{childImageSharp:{sizes:{base64:"data:image/png;base64,",aspectRatio:2,src:"/static/1*w4ALp74pUYzMQl3Nt8p3aA-7deb149afe31e8b997ed26eb3755d633-7a72d.png",srcSet:"/static/1*w4ALp74pUYzMQl3Nt8p3aA-7deb149afe31e8b997ed26eb3755d633-8baea.png 158w,\n/static/1*w4ALp74pUYzMQl3Nt8p3aA-7deb149afe31e8b997ed26eb3755d633-69705.png 315w,\n/static/1*w4ALp74pUYzMQl3Nt8p3aA-7deb149afe31e8b997ed26eb3755d633-7a72d.png 630w,\n/static/1*w4ALp74pUYzMQl3Nt8p3aA-7deb149afe31e8b997ed26eb3755d633-514af.png 945w,\n/static/1*w4ALp74pUYzMQl3Nt8p3aA-7deb149afe31e8b997ed26eb3755d633-5e778.png 1200w",sizes:"(max-width: 630px) 100vw, 630px"}}}}},next:{frontmatter:{path:"/blog/the-importance-of-psychological-safety-in-a-team/",tags:["agileontap"],title:"[The importance of] Psychological Safety in a team",date:"2018-06-08T12:42:00.000Z",description:null,image:null}}}}}});
